#include "PX_Object_LayerBox.h"

px_void PX_Object_LayerBoxListOnChanged(PX_Object* pObject, PX_Object_Event e, px_void* ptr)
{
	PX_Object* pLayerBoxObject = (PX_Object*)ptr;
	PX_Object_LayerBox* pdesc = PX_ObjectGetDesc(PX_Object_LayerBox, pLayerBoxObject);
	px_int current_edit_index;

	current_edit_index=PX_Object_ListGetCurrentSelectIndex(pdesc->list);
	if (current_edit_index<0)
	{
		return;
	}
	PX_CanvasVMLayerSetEditing(pdesc->pCanvasVM, current_edit_index);
}




px_void PX_Object_LayerBoxListItemOnRender(px_surface* psurface, PX_Object* pObject, px_dword elapsed)
{
	px_float x, y, w, h;
	PX_Object* pLayerBoxObject = (PX_Object*)pObject->User_ptr;
	PX_Object_LayerBox* pdesc=PX_ObjectGetDesc(PX_Object_LayerBox, pLayerBoxObject);
	PX_Object_Layer *pLayer=(PX_Object_Layer*)PX_Object_ListItemGetData(pObject);
	PX_Object* pButtonObject;
	PX_OBJECT_INHERIT_CODE(pObject, x, y, w, h);

	if (!pLayer->activating)
	{
		return;
	}

	//visible
	pButtonObject = PX_ObjectGetObject(pObject, ".v");
	if (pLayer->visible)
	{
		PX_Object_PushButtonSetTexture(pButtonObject, &pdesc->tex_visible);
	}
	else
	{
		PX_Object_PushButtonSetTexture(pButtonObject, &pdesc->tex_invisible);
	}

	//clip
	if (pLayer->attribute==PX_OBJECT_LAYER_ATTRIBUTE_CLIP)
	{
		PX_GeoDrawRect(psurface, (px_int)x, (px_int)y, (px_int)x + 6, (px_int)(y + h),  PX_COLOR_BLUE);
	}

	PX_TextureRender(psurface, &pLayer->surface_preview_mini, (px_int)x + 42, (px_int)y + 2, PX_ALIGN_LEFTTOP, 0);
	PX_FontModuleDrawText(psurface, pdesc->fm, (px_int)x + 100, (px_int)y + 3, PX_ALIGN_LEFTTOP, pLayer->name, PX_COLOR_BLACK);
	PX_GeoDrawBorder(psurface, (px_int)x, (px_int)y, (px_int)(x + w), (px_int)(y + h), 1, PX_COLOR_BLACK);

	//editing
	if (pLayer->editing)
	{
		PX_TextureRender(psurface, &pdesc->tex_edit, (px_int)x + 8, (px_int)y + 27, PX_ALIGN_LEFTTOP, 0);
		if (!pLayer->visible)
		{
			PX_GeoDrawLine(psurface, (px_int)x + 12, (px_int)y +31, (px_int)x + 8 + 20, (px_int)y + 27 + 20, 2, PX_COLOR_RED);
		}
		
	}
	
}

px_void PX_Object_LayerBoxOnLayerVisibleButtonClick(PX_Object* pObject, PX_Object_Event e, px_void* ptr)
{
	PX_Object* ItemObject = (PX_Object*)ptr;
	PX_Object* pLayerBoxObject= (PX_Object*)ItemObject->User_ptr;
	PX_Object_LayerBox* pdesc = PX_ObjectGetDesc(PX_Object_LayerBox, pLayerBoxObject);
	PX_CanvasVMLayerVisible(pdesc->pCanvasVM);

}

px_bool PX_Object_LayerBoxListItemOnCreate(px_memorypool* mp, PX_Object* ItemObject, px_void* userptr)
{
	PX_Object* pObject = (PX_Object*)userptr;
	PX_Object* pButton;
	PX_Object_LayerBox* pdesc;
	ItemObject->Func_ObjectRender = PX_Object_LayerBoxListItemOnRender;
	ItemObject->User_ptr = userptr;
	pdesc = PX_ObjectGetDesc(PX_Object_LayerBox, pObject);
	pButton =PX_Object_PushButtonCreate(mp, ItemObject, 8, 2, 24, 24, "", 0);
	PX_ObjectSetId(pButton, "v");
	PX_Object_PushButtonSetTexture(pButton, &pdesc->tex_visible);
	PX_Object_PushButtonSetBackgroundColor(pButton, PX_COLOR_WHITE);
	PX_Object_PushButtonSetBorderColor(pButton, PX_COLOR_BLACK);
	PX_Object_PushButtonSetCursorColor(pButton, PX_COLOR(255, 212, 212, 212));
	PX_Object_PushButtonSetPushColor(pButton, PX_COLOR(255, 192, 192, 192));
	PX_ObjectRegisterEvent(pButton, PX_OBJECT_EVENT_EXECUTE, PX_Object_LayerBoxOnLayerVisibleButtonClick, ItemObject);
	return PX_TRUE;
}

px_void PX_Object_LayerBoxUpdateList(PX_Object* pObject)
{
	PX_Object_LayerBox* pdesc = PX_ObjectGetDesc(PX_Object_LayerBox, pObject);
	px_int i;
	PX_Object_ListClear(pdesc->list);
	for (i = 0; i < PX_COUNTOF(pdesc->pCanvasVM->layers); i++)
	{
		if (pdesc->pCanvasVM->layers[i].activating)
		{
			PX_Object_ListAdd(pdesc->list, pdesc->pCanvasVM->layers + i);
		}
	}
}



