px_void PX_Object_LayerBoxFree(PX_Object* pObject)
{
	PX_Object_LayerBox* pdesc = PX_ObjectGetDesc(PX_Object_LayerBox, pObject);
	PX_TextureFree(&pdesc->tex_clip);
	PX_TextureFree(&pdesc->tex_delete);
	PX_TextureFree(&pdesc->tex_down);
	PX_TextureFree(&pdesc->tex_edit);
	PX_TextureFree(&pdesc->tex_invisible);
	PX_TextureFree(&pdesc->tex_new);
	PX_TextureFree(&pdesc->tex_up);
	PX_TextureFree(&pdesc->tex_visible);
	PX_TextureFree(&pdesc->tex_view);
}

px_void PX_Object_LayerBoxUpdatePreview(PX_Object* pObject)
{
	px_float scale;
	px_int neww, newh, ltoftx, ltofty;
	px_float vcx, vcy, vcw, vch;
	px_texture mintex;
	PX_Object_LayerBox* pdesc = PX_ObjectGetDesc(PX_Object_LayerBox, pObject);

	if (pdesc->pCanvasVM->cache_surface.width > pdesc->pCanvasVM->cache_surface.height)
	{
		scale = 120.f / pdesc->pCanvasVM->cache_surface.width;
	}
	else
	{
		scale = 120.f / pdesc->pCanvasVM->cache_surface.height;
	}
	neww = (px_int)(pdesc->pCanvasVM->cache_surface.width * scale);
	newh = (px_int)(pdesc->pCanvasVM->cache_surface.height * scale);


	if (!PX_TextureCreateScale(pdesc->ui_mp, &pdesc->pCanvasVM->cache_surface, neww, newh, &mintex))
	{
		return;
	}
	PX_SurfaceClearAll(&pdesc->tex_view, PX_COLOR(0, 255, 255, 255));
	PX_TextureRender(&pdesc->tex_view, &mintex, pdesc->tex_view.width / 2, pdesc->tex_view.height / 2, PX_ALIGN_CENTER, 0);
	ltoftx = pdesc->tex_view.width / 2 - mintex.width / 2;
	ltofty = pdesc->tex_view.height / 2 - mintex.height / 2;

	vcx = pdesc->pCanvasVM->view_x * 1.0f / pdesc->pCanvasVM->cache_surface.width * neww;
	vcy = pdesc->pCanvasVM->view_y * 1.0f / pdesc->pCanvasVM->cache_surface.height * newh;
	vcw = pdesc->pCanvasVM->view_surface.width / pdesc->pCanvasVM->scale / pdesc->pCanvasVM->cache_surface.width * neww;
	vch = pdesc->pCanvasVM->view_surface.height * 1.0f / pdesc->pCanvasVM->cache_surface.height / pdesc->pCanvasVM->scale * newh;

	PX_GeoDrawBorder(&pdesc->tex_view, (px_int)(ltoftx + vcx - vcw / 2), (px_int)(ltofty + vcy - vch / 2), (px_int)(ltoftx + vcx + vcw / 2), (px_int)(ltofty + vcy + vch / 2), 1, PX_COLOR_BLACK);

	PX_TextureFree(&mintex);
}

px_void PX_Object_LayerBoxOnRender(px_surface* psurface, PX_Object* pObject, px_uint elpased)
{
	PX_Object_LayerBox* pdesc = PX_ObjectGetDesc(PX_Object_LayerBox, pObject);

	if (pdesc->reg_state_id!=pdesc->pCanvasVM->reg_state_id)
	{
		px_int editIndex=PX_CanvasVMGetEditingLayerIndex(pdesc->pCanvasVM);
		pdesc->reg_state_id = pdesc->pCanvasVM->reg_state_id;
		PX_Object_LayerBoxUpdateList(pObject);
		PX_Object_ListSetCurrentSelectIndex(pdesc->list, editIndex);
		PX_Object_LayerBoxUpdatePreview(pObject);
	}
}


